import Layout from "../../components/shared/Layout/Layout";
import API from "../../services/API";

const Donor = () => {
  const { data, setData } = useState("");
  //find donor records
  const getDonors = async () => {
    try {
      const { data } = await API.get("/inventory/get-donors");
      console.log(data);
      //   setData(data);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    getDonors();
  }, []);

  return (
    <Layout>
      <h1>Donor Page</h1>
    </Layout>
  );
};

export default Donor;
